import React, { Component } from 'react';



class Messages extends Component {

    constructor(props){
        super(props);
        this.state = {message: []};
        this.updateMessages = this.props.updateMessagesFunction.bind(this);
    }

    divStyle = {
        display: 'flex',
        justifyContent: 'center'
    };

    render() {
        return (<div style={this.divStyle}><h1>{this.state.message}</h1></div>);
    }

}

export default Messages;
